#!/usr/bin/python
# -*- coding: utf-8 -*-

import urlparse
import logging
import copy
from blacklist import ban
from blacklist import builtin
from blacklist import custom
from blacklist import tld

__all__ = ['main']

def decode_gfwlist(content):
	# decode base64 if have to
	try:
		if '.' in content:
			raise
		return content.decode('base64')
	except:
		return content


def get_hostname(something):
	try:
		# quite enough for GFW
		if not something.startswith('http:'):
			something = 'http://' + something
		r = urlparse.urlparse(something)
		return r.hostname
	except Exception as e:
		logging.error(e)
		return None

def add_domain_to_set(s, something):
	hostname = get_hostname(something)
	if hostname is not None:
		if hostname.startswith('.'):
			hostname = hostname.lstrip('.')
		if hostname.endswith('/'):
			hostname = hostname.rstrip('/')
		if hostname:
			s.add(hostname)

def parse_gfwlist(content):
	gfwlist = content.splitlines(False)
	domains = builtin.getlist()
	for line in gfwlist:
		if line.find('.*') >= 0:
			continue
		elif line.find('*') >= 0:
			line = line.replace('*', '/')
		if line.startswith('!'):
			continue
		elif line.startswith('['):
			continue
		elif line.startswith('@'):
			# ignore white list
			continue
		elif line.startswith('||!--'):
			continue
		elif line.startswith('||'):
			add_domain_to_set(domains, line.lstrip('||'))
		elif line.startswith('|'):
			add_domain_to_set(domains, line.lstrip('|'))
		elif line.startswith('.'):
			add_domain_to_set(domains, line.lstrip('.'))
		else:
			add_domain_to_set(domains, line)
	return domains

def reduce_domains(domains):
	# reduce 'www.google.com' to 'google.com'
	# remove invalid domains
	tlds = tld.getlist()
	cuss = custom.getlist()
	bans = ban.getlist()
	new_domains = set()
	for cus in cuss:
		new_domains.add(cus)
	for domain in domains:
		domain_parts = domain.split('.')
		last_root_domain = None
		for i in xrange(0, len(domain_parts)):
			root_domain = '.'.join(domain_parts[len(domain_parts) - i - 1:])
			if i == 0:
				if not tlds.__contains__(root_domain):
					# root_domain is not a valid tld
					break
			last_root_domain = root_domain
			if tlds.__contains__(root_domain):
				continue
			else:
				break
		if last_root_domain is not None \
			and last_root_domain not in bans \
			and last_root_domain not in new_domains:
			same = False
			for cus in new_domains:
				if len(cus) < len(last_root_domain):
					if cmp(cus[::-1] + '.', last_root_domain[::-1][0:len(cus)+1]) == 0 :
						same = True
						break
				elif len(cus) > len(last_root_domain):
					if cmp(last_root_domain[::-1] + '.', cus[::-1][0:len(last_root_domain)+1]) == 0 :
						new_domains.remove(cus)
						break
			if not same :
				new_domains.add(last_root_domain)
	return new_domains

def obfs(url):
	ret = ''
	index = 0
	for c in url:
		if c == '.' or ((index & 3) == 0 and index > 0):
			last = ord(ret[-1])
			if last < 64:
				ret = "%s\\%o" % (ret[:-1], last)
			else:
				ret = "%s\\x%x" % (ret[:-1], last)
		ret += c
		index += 1
	return ret

def obfs_list(list_result):
	ret = set()
	for item in list_result:
		ret.add( obfs(item) )
	return ret

def get_all_list(lists):
	all_list = lists
	result = list()
	all_list.remove('')
	url_dict = {}
	for item in all_list:
		parts = item.split('.')
		if not url_dict.has_key(parts[-1]) :
			url_dict[parts[-1]] = list()
		url_dict[parts[-1]].append( obfs('.'.join(parts[:-1])) )

	key_comma = ''
	url_dict_keys = url_dict.keys()
	url_dict_keys.sort()
	for key in url_dict_keys:
		url_dict[key].sort()
		result.append('%s"%s":{' % (key_comma, key) )
		comma = ''
		for item in url_dict[key]:
			result.append(comma + '\n"' + item + '":1')
			comma = ','
		result.append('\n}')
		key_comma = ','
	return result

def final_list():
	with open('gfwlist.txt', 'r') as f:
		content = f.read()
	content = decode_gfwlist(content)
	#with open('gfwlist_ogn.txt', 'w') as f:
	#	f.write(content)
	domains = parse_gfwlist(content)
	list_result = get_all_list(reduce_domains(domains))
	content = ''.join(list_result)
	content = '{' + content + "\n}"
	return content

#!/usr/bin/python
# -*- coding: utf-8 -*-

import urlparse
import logging
import copy
from blacklist import gfwcustom

__all__ = ['main']

def decode_gfwlist(content):
	# decode base64 if have to
	try:
		if '.' in content:
			raise
		return content.decode('base64')
	except:
		return content


def get_hostname(something):
	try:
		# quite enough for GFW
		if not something.startswith('http:'):
			something = 'http://' + something
		r = urlparse.urlparse(something)
		return r.hostname
	except Exception as e:
		logging.error(e)
		return None

def parse_gfwlist(content):
	gfwlist = content.splitlines(False)
	rules = list()
	for line in gfwlist:
		if line.startswith('!'):
			continue
		elif line.startswith('['):
			continue
		elif len(line.strip(' ')) <= 0:
			continue
		else:
			rules.append(line)
	return rules

def obfs(url):
	ret = ''
	index = 0
	for c in url:
		if index > 0 and ( c == '.' or (index % 7) == 3 ):
			last = ord(ret[-1])
			if last < 64:
				ret = "%s\\%o" % (ret[:-1], last)
			else:
				ret = "%s\\x%x" % (ret[:-1], last)
		ret += c
		index += 1
	return ret

def obfs_list(list_result):
	ret = set()
	for item in list_result:
		ret.add( obfs(item) )
	return ret

def get_all_list(lists):
	result = list()
	key_comma = ''
	for key in lists:
		if key.startswith("@@"):
			result.append('%s"%s"\n' % (key_comma, key ) )
		else:
			result.append('%s"%s"\n' % (key_comma, obfs(key) ) )
		key_comma = ','
	return result

def final_list():
	with open('gfwlist.txt', 'r') as f:
		content = f.read()
	content = decode_gfwlist(content)
	#with open('gfwlist_ogn.txt', 'w') as f:
	#	f.write(content)
	domains = parse_gfwlist(content)
	gfwlist = list(gfwcustom.getlist())
	gfwlist.remove("")
	domains += list(gfwlist)
	list_result = get_all_list(domains)
	content = ''.join(list_result)
	content = '[' + content + "]"
	return content

#!/usr/bin/python
# -*- coding: utf-8 -*-
from argparse import ArgumentParser
import os
import re
import list_white
import list_black
import list_gfw
import list_ip

def parse_args():
	parser = ArgumentParser()
	parser.add_argument('-i', '--input', dest='input', default=os.path.join('data', 'proxy.pac'),
		help='path to gfwlist')
	parser.add_argument('-o', '--output', dest='output', default='proxy.pac',
		help='path to output pac', metavar='PAC')
	parser.add_argument('-p', '--proxy', dest='proxy', default='"SOCKS5 127.0.0.1:1080;"',
		help='the proxy parameter in the pac file, for example,\
		"SOCKS5 127.0.0.1:1080;"', metavar='SOCKS5')
	parser.add_argument('-a', '--auto_proxy', dest='auto_proxy', default='auto',
		help='the auto proxy parameter in the pac file, for example,\
		"SOCKS5 127.0.0.1:1080;"', metavar='SOCKS5')
	parser.add_argument('-d', '--directip_proxy', dest='ip_proxy', default='auto',
		help='the auto proxy parameter in the pac file, for example,\
		"SOCKS5 127.0.0.1:1080;"', metavar='SOCKS5')
	parser.add_argument('-z', '--dynamic', dest='dynamic', default='no')
	return parser.parse_args()

def get_file_data(filename):
	content = ''
	with open(filename, 'r') as file_obj:
		content = file_obj.read()
	return content

def js_shorter(content):
	result = []
	class ParseState(object):
		def __init__(self):
			self.state = 'empty'
			self.buff = ''
			self.cur = ''
			self.laststate = 'empty'
			self.word_set = set()
			for i in xrange(26):
				self.word_set.add(chr(i + ord('A')))
				self.word_set.add(chr(i + ord('a')))
			for i in xrange(10):
				self.word_set.add(chr(i + ord('0')))
			self.word_set.add('_')
			self.word_set.add('$')
			self.empty_set = set([' ', '\t', '\r', '\n'])
		def retbuf(self):
			ret = self.buff
			self.buff = ''
			return ret
		def next(self, ch):
			self.buff += self.cur
			self.cur = ch
			if self.state == 'empty':
				if ch in self.empty_set:
					self.cur = ''
				elif ch in self.word_set:
					self.state = 'word'
					if self.laststate == 'word':
						return ' ' + self.retbuf()
					return self.retbuf()
				elif ch == '/':
					self.state = 'slash'
				elif ch == '"':
					self.state = 'string'
				else:
					self.state = 'symbol'
			elif self.state == 'symbol': # symbol
				self.laststate = 'symbol'
				if ch in self.empty_set:
					self.cur = ''
					self.state = 'empty'
				elif ch in self.word_set:
					self.state = 'word'
				elif ch == '/':
					self.state = 'slash'
				elif ch == '"':
					self.state = 'string'
				else:
					self.state = 'symbol'
				return self.retbuf()
			elif self.state == 'word':
				self.laststate = 'word'
				if ch in self.empty_set:
					self.cur = ''
					self.state = 'empty'
					return self.retbuf()
				elif ch in self.word_set:
					self.state = 'word'
				elif ch == '/':
					self.state = 'slash'
					return self.retbuf()
				elif ch == '"':
					self.state = 'string'
					return self.retbuf()
				else:
					self.state = 'symbol'
					return self.retbuf()
			elif self.state == 'string':
				if ch == '"':
					self.cur = ''
					self.state = 'empty'
					return self.retbuf() + ch
				elif ch == '\\':
					self.state = 'string_conv'
			elif self.state == 'string_conv':
				self.state = 'string'
			elif self.state == 'slash': # just OK in this case
				if ch == '/':
					self.state = 'comment'
				elif ch == '*':
					self.state = 'multiline_comment'
				else:
					self.state = 'symbol'
					cur = self.cur
					self.cur = ''
					return self.next(ch)
			elif self.state == 'comment':
				if ch == '\n':
					self.buff = ''
					self.cur = ''
					self.state = 'empty'
			elif self.state == 'multiline_comment':
				if ch == '*':
					self.state = 'multiline_comment_ed1'
			elif self.state == 'multiline_comment_ed1':
				if ch == '/':
					# keep multiline_comment
					self.state = 'symbol'
				else:
					self.state = 'multiline_comment'
			return ''
	prase = ParseState()
	for c in content:
		r = prase.next(c)
		if len(r) > 0:
			result.append(r)
	return ''.join(result)

def writefile(input_file, proxy, auto_proxy, ip_proxy, output_file, dynamic):
	ip_content = list_ip.final_list()
	ip16_content = list_ip.center_list()
	proxy_content = get_file_data(input_file)
	proxy_content = proxy_content.replace('__IP_LIST__', ip_content)
	proxy_content = proxy_content.replace('__IP16_LIST__', ip16_content)
	proxy_content = proxy_content.replace('__FAKE_IP_LIST__', list_ip.fake_list())
	proxy_content = proxy_content.replace('__WHITE_DOMAINS__', list_white.final_list())
	if '__BLACK_DOMAINS__' in proxy_content:
		proxy_content = proxy_content.replace('__BLACK_DOMAINS__', list_black.final_list())
	if '__GFWBLACK_DOMAINS__' in proxy_content:
		proxy_content = proxy_content.replace('__GFWBLACK_DOMAINS__', list_gfw.final_list())

	if dynamic != 'no':
		with open(dynamic + output_file, 'w') as file_obj:
			file_obj.write( js_shorter(proxy_content) )

	proxy_content = proxy_content.replace('__PROXY__', proxy)
	proxy_content = proxy_content.replace('__NOWALL_PROXY__', '"DIRECT;"')
	proxy_content = proxy_content.replace('__IP_PROXY__', ip_proxy)
	proxy_content = proxy_content.replace('__AUTO_PROXY__', auto_proxy)
	proxy_content = proxy_content.replace('__DIRECT__', '"DIRECT;"')
	with open(output_file, 'w') as file_obj:
		file_obj.write(proxy_content)

	with open('min_' + output_file, 'w') as file_obj:
		file_obj.write(js_shorter(proxy_content))

def get_default_param(param, defstring, defval):
	if param == defstring:
		return defval
	return '"' + param.strip('"') + '"'

def main():
	args = parse_args()

	auto_proxy = get_default_param(args.auto_proxy, 'auto', 'wall_proxy')
	ip_proxy = get_default_param(args.ip_proxy, 'auto', 'nowall_proxy')

	writefile(args.input, '"' + args.proxy.strip('"') + '"', auto_proxy, ip_proxy, args.output, args.dynamic)

if __name__ == '__main__':
	main()

